import React from 'react'

const DaysBar = props => {
    const days = props.days


    return(
        <ul>
            {days.map((day) => {
                return <li key={day.dt}>{new Date(day.dt * 1000)}</li>
            })}
        </ul>
    )
}

export default DaysBar
